import React from 'react';
import { Typography, Button, Card, CardActions, cardContent, CardMedia, CardContent } from '@material-ui/core';

const CartItem = ({ item }) => {
    const classes = useStyles();

    return (
        <div>
            <CardMedia image={item.media.soruce} alt={item.name} className={classes.media} />
            <CardContent className={classes.cardContent}>
                <Typography variant="h4">{item.name}</Typography>
                <Typography variant="h4">{item.line_total.formatted_with_symbol}</Typography>
            </CardContent>
        </div>
    )
}

export default CartItem
